import React from "react";
import styles from './Certification.module.css';
import { Swiper, SwiperSlide } from 'swiper/react';

import 'swiper/css';
import 'swiper/css/effect-coverflow';
import 'swiper/css/pagination';
import 'swiper/css/navigation';

import { EffectCoverflow, Pagination, Navigation } from "swiper/modules";

import az204 from '../../assets/certification/az204.png';
import az104 from '../../assets/certification/az104.png';
import ai102 from '../../assets/certification/ai 102.png';

// Install Swiper modules



export const Certification = () => {
  return (
    <section className={styles.container} id="Certification">
      <h2 className={styles.title}>Certifications</h2>
      <p />
      <>
        <img src={az104} alt="Azure administration Associate" />
        <img src={az204} alt="Azure administration Associate" className={styles.img} />
        <img src={ai102} alt="Azure administration Associate" />
      </>

    </section>
  )
}
